import { StyleSheet } from 'react-native'

import { colorLight } from '../../config/styles'

export const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
    titleContainer: {
        flex: 1,
        justifyContent: 'flex-start',
        top: 253,
        gap: 21,
    },
    title: {
        fontSize: 28,
        color: colorLight,
        fontWeight: 'bold',
    },
    subtitle: {
        fontSize: 24,
        color: colorLight,
    },
    buttonContainer: {
        flex: 1,
        justifyContent: 'flex-end',
        gap: 30,
        bottom: 150,
    },
})
